import React, { useEffect, useState } from "react";

export const SummaryTable = ({ data }) => {
  const [summaryData, setsummaryData] = useState<any>(data);

  useEffect(() => {
    setsummaryData(data);
  }, [data]);

  console.log(summaryData, data);
  return (
    <div>
      <table className="table">
        <thead>
          <tr>
            <th className="each-column-border">Rank </th>
            <th className="each-column-border">Entity Name</th>
          </tr>
        </thead>
        <tbody>
          {summaryData?.map((item, index) => (
            <tr>
              <td className="each-column-border">{index + 1}</td>
              <td className="each-column-border">{item.companyName}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};
